import {
  Add as AddIcon,
  EmailOutlined as Email,
  Phone,
  ArrowForward as ArrowForwardIcon,
} from '@mui/icons-material';
import {
  Box,
  Breadcrumbs,
  Divider,
  Link,
  List,
  ListItem,
  ListItemButton,
  ListItemText,
  ListSubheader,
  Typography,
  IconButton,
  CircularProgress,
} from '@mui/material';
import { blueGrey } from '@mui/material/colors';
import React, { useEffect, useState } from 'react';
import { useFetch } from '../../hooks';
import { API, getURI } from '../../services';
import * as Styled from './StatusList.styled';

interface IPilot {
  id: number;
  userId: number;
  firstName: string;
  lastName: string;
  cpf: string;
  cellphone: string;
  email: string;
  status: string;
}

interface ApiResponse {
  success: boolean;
  count: number;
  data: IPilot[];
}

export const StatusList: React.FC = () => {
  const [pilots, setPilots] = useState<IPilot[]>([]);
  const { doFetch, data, error, loading } = useFetch<ApiResponse>({
    url: getURI(API.status), // http://localhost:8000/pilots/status-list
    method: 'GET',
  });

  useEffect(() => {
    return doFetch({ url: getURI(API.status) }); // Trigger fetch on mount
  }, [doFetch]);

  useEffect(() => {
    if (data!.success && data!.data.length) {
      setPilots(data!.data);
    } else {
      setPilots([]);
    }
  }, [data]);

  return (
    <Box>
      <Box sx={{ padding: '15px' }}>
        <Breadcrumbs aria-label="breadcrumb">
          <Link underline="hover" color="inherit" href="/">
            Dashboard
          </Link>
          <Typography color="text.primary">Pilotos Ativos</Typography>
        </Breadcrumbs>
      </Box>
      {loading && (
        <Box display="flex" justifyContent="center" alignItems="center" minHeight="400px">
          <CircularProgress />
          <Typography sx={{ ml: 2 }} color="text.secondary">
            Carregando pilotos ativos...
          </Typography>
        </Box>
      )}
      {error && (
        <Typography color="error" sx={{ padding: '15px' }}>
          Erro: {error}
        </Typography>
      )}
      {pilots.length ? (
        <List
          subheader={
            <ListSubheader component="div" id="nested-list-subheader" color="primary">
              Total de {pilots.length} piloto(s) ativo(s)
            </ListSubheader>
          }
        >
          {pilots.map((pilot) => (
            <React.Fragment key={pilot.id}>
              <ListItem
                disablePadding
                secondaryAction={
                  <IconButton edge="end" aria-label="ver detalhes">
                    <ArrowForwardIcon />
                  </IconButton>
                }
              >
                <ListItemButton>
                  <ListItemText
                    primary={`${pilot.firstName} ${pilot.lastName}`}
                    secondary={
                      <>
                        <Box sx={{ display: 'flex', alignItems: 'center', mb: 0.5 }}>
                          <Phone sx={{ fontSize: '14px' }} />
                          <Typography
                            sx={{ paddingLeft: '5px', paddingTop: '2px' }}
                            variant="caption"
                            color={blueGrey[500]}
                          >
                            {pilot.cellphone}
                          </Typography>
                        </Box>
                        <Box sx={{ display: 'flex', alignItems: 'center' }}>
                          <Email sx={{ fontSize: '15px', mr: 1 }} />
                          <Typography
                            sx={{ paddingLeft: '5px' }}
                            variant="caption"
                            color={blueGrey[500]}
                          >
                            {pilot.email}
                          </Typography>
                        </Box>
                      </>
                    }
                  />
                </ListItemButton>
              </ListItem>
              <Divider />
            </React.Fragment>
          ))}
        </List>
      ) : (
        !loading && (
          <Typography sx={{ padding: '15px' }}>Nenhum piloto ativo encontrado.</Typography>
        )
      )}
      <Styled.AddButton color="primary" aria-label="add">
        <AddIcon />
      </Styled.AddButton>
    </Box>
  );
};
